import { useContext } from "react";
import {useState, useEffect } from "react";
import Context from "./Context";
import { ZodiacSignsDetail } from "./data";
const url="https://raw.githubusercontent.com/sannlynnhtun-coding/Zodiac/main/Zodiac.json";

function Zodiac(){


    const value = useContext(Context);
    const [name,setName] = useState([]);
     function getName(){ 
      //const response = await fetch(url);
      //const name = await response.json();
      const name = ZodiacSignsDetail;
      setName(name);
      console.log(name);
  
    }
      
    useEffect(()=>{
      getName();
  
    },[]);
  
   
   
    return(
      <div className="">  
      
        <ul className="">
        {ZodiacSignsDetail.map((ZodiacSignsDetail)=>{
             return(
                <div className="ctn">
                    
                      <img id='picture' src={ZodiacSignsDetail.ZodiacSign2ImageUrl} alt={ZodiacSignsDetail.Name}/>
                      <div className="page">
                         <h1>{ZodiacSignsDetail.Name}</h1> 
                         <h2>{ZodiacSignsDetail.MyanmarMonth}</h2> 
                         <h4 id="mth">{ZodiacSignsDetail.Dates}</h4>
                         <h4>{ZodiacSignsDetail.Title0}</h4><h4>{ZodiacSignsDetail.Element}</h4>
                        <h4>{ZodiacSignsDetail.Title1}</h4><h4>{ZodiacSignsDetail.LifePurpose}</h4> 
                        <h4>{ZodiacSignsDetail.Loyal}</h4>
                        <h4>{ZodiacSignsDetail.RepresentativeFlower}</h4>
                        <h4>{ZodiacSignsDetail.Angry}</h4>
                        <h4>{ZodiacSignsDetail.Character}</h4>

                      </div>
                  
                </div>
               
              )
          })}
        </ul>
        
       </div> );

};


export default Zodiac;
